import React from 'react'
import {useState} from 'react';

const Header = () => {
    const styleHeader={
      color:'green',
        backgroundColor:'white',
        padding:'10px',
        textAlign:'center',
        fontSize:'20px',
        fontFamily:'Arial',
        fontWeight
        :'bold'} 

    const title={
        color:'white',
        backgroundColor:'blue',
        padding:'10px',
        textAlign:'center',
        fontSize:'40px',
        fontFamily:'Arial',
        fontWeight:'bold'}  
    const Button={  
        color:'white',
        backgroundColor:'blue',
        padding:'10px',
        textAlign:'center',
        fontSize:'20px',
        fontFamily:'Arial',
        fontWeight:'bold'}   


    function NameChange(){
        const names=["Money"];
        const poss=Math.floor(Math.random());
        return (names[poss]);
        } 
    const [isDark,setIsDark]=useState(false);
    return(
       <>
            <h1 style ={title}>  To do List</h1>
            <p style={styleHeader}> 
            <p>Lets Earn{NameChange()} </p>
            <button onClick={()=>{setIsDark(!isDark)}} style={Button}>Click Me</button>
            <p>{ isDark ? "white" : "black"}</p>
            </p>
        </>    

    )
}

export default Header
